#include <iostream>
#include <vector>
#include <random>
#include <utility>
using namespace std;
typedef long long ll;

void sieve(int n, vector<int>& primes, vector<int>& div_ind) {
	primes.reserve(n+1);
	div_ind.resize(n+1);
	for (int i = 0; i <= n; ++i) div_ind[i] = -1;
	for (int i = 2; i <= n; ++i) {
		if (div_ind[i] == -1) {
			div_ind[i] = primes.size();
			primes.push_back(i);
		}
		for (int j = 0; j <= div_ind[i]; ++j) {
			int t = primes[j] * i;
			if (t > n) break;
			div_ind[t] = j;
		}
	}
}

ll modPow(ll w, ll u, ll val) {
	if (u & 1) return (w * modPow(w, u-1, val)) % val;
	if (u == 0) return 1;
	ll sub = modPow(w, u>>1, val);
	return (sub * sub) % val;
}

bool isWitness(ll w, ll even, ll odd, ll val) {
	w = modPow(w, odd, val);
	if (w == 1) return 0;
	for (int i = 0; i < even; ++i) {
		ll nw = (w * w) % val;
		if (nw == 1) return (w != val-1);
		w = nw;
	}
	return 1;
}

// Deterministic Miller-Rabin
// https://miller-rabin.appspot.com/
// Time Complexity: O(log(val))
// Preconditions: 128-bit integers are required for testing 64-bit numbers.
bool isPrime(ll val) {
	if (val <= 1 || ((val & 1) == 0 && val > 2)) return 0;
	ll even = 0;
	ll odd = val-1;
	while(!(odd & 1)) {
		++even;
		odd >>= 1;
	}
	ll b[7] = {2, 325, 9375, 28178, 450775, 9780504, 1795265022};
	for (int i = 0; i < 7; ++i) {
		ll w = b[i] % val;
		if (w == 0) return 1;
		if (isWitness(w, even, odd, val)) return 0;
	}
	return 1;
}

// Calculates largest x such that x*x <= v
// Time Complexity: O(log(v))
// Preconditions: x < 2^31
ll lowerSqrt(ll v) {
	ll x = 0;
	ll xx = 0;
	for (int j = 30; j >= 0; --j) {
		ll nxx = (xx) + (x<<(j+1)) + ((ll)1 << (2*j));
		if (nxx <= v) {
			xx = nxx;
			x |= (1<<j);
		}
	}
	return x;
}

ll gcd(ll a, ll b) {
	if (b == 0) return a;
	return gcd(b, a % b);
}


// find x such that x |v.
// Time Complexity: expected O(sqrt(v) * log(v))
// Preconditions: v % 2 != 0, there is no x such that x^k = v for k > 1, v is not prime
ll pollardRho(ll v) {
	// cout << "pollard(" << v << ")\n";
	for (int c = 1;; ++c) {
		ll x = rand() % v;
		ll y = ((ll)x * x + c) % v;
		int l = 16;
		ll ph = abs(x-y);
		for (int i = 0;; ++i) {
			if (i % 10 == 0) {
				ll g = gcd(ph, v);
				if (g != 1) {
					if (g == v) break;
					else {
						// cout << "found " << g << '\n';
						return g;
					}
				}
				ph = 1;
			}
			if (i == l) {
				x = y;
				l *= 2;
			}
			// x = ((ll)x * x + c) % v;
			// y = ((ll)y * y + c) % v;
			y = ((ll)y * y + c) % v;
			ph = (ph * (abs(x-y))) % v;
		}
	}
}


