void factor(ll v, unsigned int* res, const vector<int>& primes) {
	for (int j = 0; j < primes.size(); ++j) {
		while(true) {
			ll rem = v / primes[j];
			if (rem * primes[j] == v) {
				v = rem;
				unsigned int tmp = 1;
				for (int i = 0; i < 4; ++i) {
					res[i] += tmp;
					tmp *= (unsigned int)primes[j];
				}
			} else {
				break;
			}
		}
	}

	if (v != 1) {
		vector<ll> to_factor = {v};
		while(! to_factor.empty()) {
			v = to_factor.back();
			if (isPrime(v)) {
				unsigned int tmp = 1;
				for (int i = 0; i < 4; ++i) {
					res[i] += tmp;
					tmp *= v;
				}
				to_factor.pop_back();
			} else {
				ll p = pollardRho(v);
				to_factor.back() /= p;
				to_factor.push_back(p);
			}
		}
	}
}

